const config = {
  host: "localhost:5001/api/v1/"
}

const userService = {}
userService.Login = function (username, password) {
  const api = config.host + "login"
  const body = {
    username: username,
    password: password
  }

  console.log(body)
  return
}

export default function UserService() {
  return userService
}
